let data=[{
    name1:"squirrel",
    wt:"200gm",
    image:"https://upload.wikimedia.org/wikipedia/commons/thumb/1/15/EasternGraySquirrel_GAm.jpg/220px-EasternGraySquirrel_GAm.jpg"
},
{
    name1:"cat",
    wt:"2kg",
    image:"data:image/jpeg;base64,"
},
{
    name1:"lion",
    wt:"200kg",
    image:"data:image/jpeg;base64,"
},
{
    name1:"tiger",
    wt:"200kg",
    image:"data:image/jpeg;base64,"
}
];
let img=document.querySelector("img")
let h2=document.querySelectorAll("h2")
let btns=document.querySelectorAll("button")
let num=0
btns[0].addEventListener("click",()=>{
    num--
    if(num<0)
    {
        num=data.length-1
    }
    changeContent(num)
})
btns[1].addEventListener("click",()=>{
    num++
    if(num>data.length-1)
    {
        num=0
    }
    changeContent(num)
    console.log("nxt");
})
console.log(data[0].wt);

function changeContent(para){
    img.src=data[para].image
    h2[0].innerText=data[para].name1
    h2[1].innerText=data[para].wt
}
window.addEventListener("DOMContentLoaded",()=>{
     changeContent(0)
     console.log("after creating dom tree")
})
setInterval(()=>{
    num++
    if(num>data.length-1)
    {
        num=0
    }
    changeContent(num)
},1000);

